// src/pages/Resources.js
import React from 'react';

function Resources() {
  return (
    <div>
      <h1>Resources</h1>
      <ul>
        <li><a href="https://example.com/resource1" target="_blank" rel="noopener noreferrer">Resource 1</a></li>
        <li><a href="https://example.com/resource2" target="_blank" rel="noopener noreferrer">Resource 2</a></li>
        <li><a href="https://example.com/resource3" target="_blank" rel="noopener noreferrer">Resource 3</a></li>
      </ul>
    </div>
  );
}

export default Resources;
